import React from 'react';

const ItemCard = (props) => {

    const {item} = props;

    return (

        <div className="product-card">
          <div className="product-image">
            <img src={item.strMealThumb} />
          </div>
          <div>
            <h3>{item.strCategory}</h3>
          </div>
        </div>
      );


};
export default ItemCard;
